import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Datafetch = () => {
    const [scriptName, setScriptName] = useState('');
    const [date, setDate] = useState('');
    const [tradingScript, setTradingScript] = useState('');

    const fetchTradingScript = async () => {
        try {
            const response = await axios.get('http://localhost:8000/datafetch/datafetch', {
                params: { script_name: scriptName, date: date }
            });
            setTradingScript(response.data);
        } catch (error) {

            console.error('Error fetching trading script:', error);
        }
    };

    return (
        <div>
            <h1>Trading App</h1>
            <div>
                <label>Script Name:</label>
                <input
                    type="text"
                    value={scriptName}
                    onChange={(e) => setScriptName(e.target.value)}
                />
            </div>
            <div>
                <label>Date:</label>
                <input
                    type="text"
                    value={date}
                    onChange={(e) => setDate(e.target.value)}
                />
            </div>
            <button onClick={fetchTradingScript}>Fetch Trading Script</button>
            <p>Trading Script:</p>
            <pre>{tradingScript}</pre>
            {/* Display other components such as forms */}
        </div>
    );
};

export default Datafetch;
